import './App.css';
import styled from 'styled-components';

const Container = styled.div`
  width: 100vw;
`;

const Header = styled.header`
  width: 100%;
  height: 80px;
  background-color: #2d4a22;

  h1 {
    color: #fff;
    font-weight: 100;
  }
`;


function App() {
  return (
    <Container>
      <Header>
        <h1>Prova</h1>
      </Header>
      <h2>Contatos</h2>

      <table>
        <thead>
          <tr>
            <th>E-mail</th>
            <th>Telefone</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>fernando@gmail.com</td>
            <td>45998450528</td>
          </tr>
          <tr>
            <td>fernando@gmail.com</td>
            <td>45998450528</td>
          </tr>
          <tr>
            <td>fernando@gmail.com</td>
            <td>45998450528</td>
          </tr>
        </tbody>
      </table>
    </Container>
  );
}

export default App;
